import React from "react";
import styles from "./Header.module.css";
import Navbar from "./Navbar/Navbar";
import Content from "./Content/Content";

const Header = () => {
  return (
    <header className={styles.header}>
      <Navbar />
      <Content />
      <div className={styles.header__props}>
        <div>
          <div className="icon">
            <img src="" />
          </div>
          <div className="prop_desc">
            Установка под размер Вашей кухни за 72 часа;
          </div>
        </div>
        <div>
          <div className="icon">
            <img src="" />
          </div>
          <div className="prop_desc">Гарантия 5 лет;</div>{" "}
        </div>
        <div>
          <div className="icon">
            <img src="" />
          </div>
          <div className="prop_desc">Бесконтактное управление светом;</div>
        </div>
        <div>
          <div className="icon">
            <img src="" />
          </div>
          <div className="prop_desc"> Эксклюзивность.</div>{" "}
        </div>
      </div>
    </header>
  );
};

export default Header;
